import { Header } from '../Components/Header';
import { Footer } from '../Components/Footer';
import '../style/main.css';
export function Home () {
    return (
        <div className="main-wrapper">
            <Header/>
            <Header/>
            <br></br>
            <h1>My Home Component</h1>
            <br></br>
            <Footer/>
        </div>
    )
}
